import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
                <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          <h1 className='text-3xl font-bold underline'>Learn React</h1> 
        </a>
      </header>
    </div>
  );
}

export default App;
